import bgCardFront from "../images/bg-card-front.png";
import bgCardBack from "../images/bg-card-back.png";
import bgMainMobile from "../images/bg-main-mobile.png";
import HeaderImage from "./HeaderImage";
import CardDetails from "./CardDetails";

const Header = () => {
  return (
    <header className="header">
      <HeaderImage
        namesOfClasses="background-header-img"
        source={bgMainMobile}
        altText="header background of a purple gradient"
      />
      <HeaderImage
        namesOfClasses="back-of-card-header-img"
        source={bgCardBack}
        altText="back of a sample credit card"
      />
      <HeaderImage
        namesOfClasses="front-of-card-header-img"
        source={bgCardFront}
        altText="front of a sample credit card"
      />
      <p className="back-of-card-text">000</p>
      <CardDetails
        cardNumber="1234 5678 9123 0000"
        cardHolder="Jane Appleseed"
        cardExpiration="00/00"
      />
    </header>
  );
};

export default Header;
